  false,\n\t\"url\": null,\n\t\"notes\": \"As a part of National Marine Fisheries
  Service (NMFS) management of the endangered Cook Inlet beluga whale population,
  a database of opportunistic beluga whale sightings was compiled from reports made
  by the general public, aircraft patrols, wildlife surveys, and military and industry
  monitoring studies.  Sightings are reported to NMFS Alaska Regional (AKR) office
  personnel either by voice- or e-mail. Sighting data are then transcribed and sent
  to the NMFS National Marine Mammal Laboratory (NMML) for entry into the database.
  Data are first assessed for quality during transcription by NMFS AKR personnel.
  \ Secondary review and confirmation is undertaken by NMFS NMML personnel prior to
  entry of data into the Access Database.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
